import React from 'react'

const Skills = () => {
    return (
        <>  
            <div className='white-bg-1'>
                <section data-aos="fade-up" className="skills-container">
                    <div className="titles">
                        <h1>Skills</h1>
                    </div>
                    <div className='skills'>
                        <div className='programming-languages'></div>
                    </div>
                </section>
            </div>
        </>
    );
}

export default Skills;
